  `id_pelanggan` char(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `total` double(12, 2) NULL DEFAULT 0.00,
  `disc` double(4, 2) NULL DEFAULT 0.00,
  `disc_ammount` double(12, 0) NULL DEFAULT NULL,
  `grand_total` double(12, 2) NULL DEFAULT 0.00,
  `id_karyawan` char(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `shift` char(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `sid` char(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  PRIMARY KEY (`kode_trans`) USING BTREE,
  INDEX `idpelanggansale`(`id_pelanggan`) USING BTREE,
  INDEX `idkaryawansale`(`id_karyawan`) USING BTREE,
  INDEX `shiftsale`(`shift`) USING BTREE,
  CONSTRAINT `tbl_sale_hold_ibfk_1` FOREIGN KEY (`id_karyawan`) REFERENCES `karyawan` (`kode_karyawan`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `tbl_sale_hold_ibfk_2` FOREIGN KEY (`id_pelanggan`) REFERENCES `pelanggan` (`id_pelanggan`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `tbl_sale_hold_ibfk_3` FOREIGN KEY (`shift`) REFERENCES `shift` (`kode_shift`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Compact;

