-- ----------------------------
-- View structure for v_all_hutang
-- ----------------------------
DROP VIEW IF EXISTS `v_all_hutang`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_all_hutang` AS select `hutang`.`id` AS `ID`,`hutang`.`tran_date` AS `TGL`,`hutang`.`kode_trans` AS `REFNUM`,`v_all_purchase`.`JNS` AS `JNS`,`v_all_purchase`.`PO` AS `PO`,`hutang`.`faktur` AS `FAKTUR`,`hutang`.`id_supplier` AS `SUPID`,`v_all_purchase`.`SUPPLIER` AS `SUPPLIER`,`hutang`.`total` AS `TOTAL`,`hutang`.`terbayar` AS `TERBAYAR`,`hutang`.`sisa` AS `SISA`,`hutang`.`flag` AS `FLAG`,`supplier`.`alamat` AS `ALAMAT`,`supplier`.`telpon` AS `TELP`,`supplier`.`fax` AS `FAX`,`supplier`.`email` AS `EMAIL` from ((`hutang` join `v_all_purchase` on((`v_all_purchase`.`REFNUM` = `hutang`.`kode_trans`))) join `supplier` on((`hutang`.`id_supplier` = `supplier`.`id`))) order by `hutang`.`tran_date`;

