-- ----------------------------
-- Procedure structure for insertMutasi
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertMutasi`;
delimiter ;;
CREATE PROCEDURE `insertMutasi`(IN P_KODEITEM VARCHAR(20), IN P_QTY INT(12), IN P_TYPE VARCHAR(50))
BEGIN
	DECLARE COUNT INT DEFAULT 0;
	SET COUNT =(SELECT COUNT(kode_item) FROM mutasi_stock WHERE kode_item= P_KODEITEM AND tipe_mutasi=P_TYPE AND tran_date=CURDATE());
	IF(COUNT=0) THEN
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),P_KODEITEM,P_TYPE,P_QTY);
	ELSE
			UPDATE mutasi_stock SET qty=qty + P_QTY WHERE tran_date=CURDATE() AND kode_item=P_KODEITEM AND tipe_mutasi=P_TYPE; 
	END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for insertPiutang
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertPiutang`;
delimiter ;;
CREATE PROCEDURE `insertPiutang`(IN P_FAKTUR VARCHAR(20), IN P_IDPEL VARCHAR(20), IN P_TOTAL DOUBLE, IN P_UID VARCHAR(30))
BEGIN
	INSERT INTO piutang VALUES (UUID(), P_FAKTUR, NOW(), P_IDPEL, P_TOTAL, 0, P_TOTAL, 0, P_UID);
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for updateStock
-- ----------------------------
DROP PROCEDURE IF EXISTS `updateStock`;
delimiter ;;
CREATE PROCEDURE `updateStock`(IN P_KODEITEM VARCHAR(20), IN P_QTY INT(12), IN P_TYPE VARCHAR(50))
BEGIN
	DECLARE COUNT INT DEFAULT 0;
	DECLARE TMP INT DEFAULT 0;
	
	DECLARE QTY_UPDATE INT DEFAULT 0;
	DECLARE QTY_UPDATE_3 INT DEFAULT 0;
	DECLARE QTY_UPDATE_2 INT DEFAULT 0;
	
	DECLARE KODE varchar(50);
	
	DECLARE ID_ITEM_1 varchar(50);
	DECLARE ID_ITEM_2 varchar(50);
	DECLARE ID_ITEM_3 varchar(50);
	DECLARE ID_ITEM_4 varchar(50);

	DECLARE KONVERSI_1 INT DEFAULT 0;
	DECLARE KONVERSI_2 INT DEFAULT 0;
	DECLARE KONVERSI_3 INT DEFAULT 0;
	DECLARE KONVERSI_4 INT DEFAULT 0;
	
	DECLARE STOCK_1 INT DEFAULT 0;
	DECLARE STOCK_2 INT DEFAULT 0;
	DECLARE STOCK_3 INT DEFAULT 0;
	DECLARE STOCK_4 INT DEFAULT 0;

	DECLARE VALUE_1 INT DEFAULT 0;
	DECLARE VALUE_2 INT DEFAULT 0;
	DECLARE VALUE_3 INT DEFAULT 0;
	DECLARE VALUE_4 INT DEFAULT 0;
	DECLARE SISA INT DEFAULT 0;
	
	SELECT COUNT(id_item) INTO COUNT FROM item_stock WHERE id_item=P_KODEITEM;
	IF(@count=0) THEN
		INSERT INTO item_stock VALUES (P_KODEITEM,0);
	END IF;
	
	SELECT ke, kode_item INTO TMP, KODE FROM item_detail WHERE id=P_KODEITEM;
	
	SELECT id, konversi INTO ID_ITEM_1, KONVERSI_1 FROM item_detail WHERE kode_item=KODE AND ke=1;
	SELECT stock INTO STOCK_1 FROM item_stock WHERE id_item=ID_ITEM_1;
	
	SELECT id, konversi INTO ID_ITEM_2, KONVERSI_2 FROM item_detail WHERE kode_item=KODE AND ke=2;
	SELECT stock INTO STOCK_2 FROM item_stock WHERE id_item=ID_ITEM_2;
	
	SELECT id, konversi INTO ID_ITEM_3, KONVERSI_3 FROM item_detail WHERE kode_item=KODE AND ke=3;
	SELECT stock INTO STOCK_3 FROM item_stock WHERE id_item=ID_ITEM_3;
	
	SELECT id, konversi INTO ID_ITEM_4, KONVERSI_4 FROM item_detail WHERE kode_item=KODE AND ke=4;
	SELECT stock INTO STOCK_4 FROM item_stock WHERE id_item=ID_ITEM_4;
	
	IF (TMP>1) THEN
		IF(TMP=4) THEN
			SET QTY_UPDATE = STOCK_4 - P_QTY;
			IF(QTY_UPDATE < 0) THEN
				SET VALUE_3 = 1;
				SET SISA = (KONVERSI_4 * VALUE_3) + QTY_UPDATE;
				
				IF(KONVERSI_4 > 0) THEN
					WHILE SISA<0 DO
						SET VALUE_3 = VALUE_3+1;
						SET SISA = (KONVERSI_4 * VALUE_3) + QTY_UPDATE;
					END WHILE;
				END IF;
				
				SET QTY_UPDATE = SISA;
				
-- 				cek stok satuan 3
				SET QTY_UPDATE_3 = STOCK_3 - VALUE_3;
				IF(QTY_UPDATE_3 < 0) THEN
					SET VALUE_2 = 1;
					SET SISA = (KONVERSI_3 * VALUE_2) + QTY_UPDATE_3;
					
					IF(KONVERSI_3 > 0) THEN	
						WHILE SISA < 0 DO
							SET VALUE_2 = VALUE_2+1;
							SET SISA = (KONVERSI_3 * VALUE_2) + QTY_UPDATE_3;
						END WHILE;
					END IF;
					SET QTY_UPDATE_3 = SISA;
				ELSE
					SET VALUE_2 = 0;
				END IF;
				
-- 				cek stok satuan 2
				SET QTY_UPDATE_2 = STOCK_2-VALUE_2;
				IF(QTY_UPDATE_2 < 0) THEN
					SET VALUE_1 = 1;
					SET SISA = (KONVERSI_2 * VALUE_1) + QTY_UPDATE_2;
					
					IF(KONVERSI_2 > 0) THEN	
						WHILE SISA<0 DO
							SET VALUE_1 = VALUE_1+1;
							SET SISA = (KONVERSI_2 * VALUE_1) + QTY_UPDATE_1;
						END WHILE;
					END IF;
					SET QTY_UPDATE_2 = SISA;
				ELSE
					SET VALUE_1 = 0;
				END IF;
				
				UPDATE item_stock set stock= QTY_UPDATE WHERE id_item=P_KODEITEM;
				IF (VALUE_3 > 0) THEN
					UPDATE item_stock set stock= QTY_UPDATE_3 WHERE id_item= ID_ITEM_3;
					CALL insertMutasi(ID_ITEM_3, VALUE_3, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_4, (VALUE_3 * KONVERSI_4), 'INVERSI');
				END IF;
				
				IF (VALUE_2 > 0) THEN
					UPDATE item_stock set stock= QTY_UPDATE_2 WHERE id_item= ID_ITEM_2;
					CALL insertMutasi(ID_ITEM_2, VALUE_2, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_3, (VALUE_2 * KONVERSI_3), 'INVERSI');
				END IF;
				
				IF (VALUE_1 > 0) THEN
					UPDATE item_stock set stock=stock-VALUE_1 WHERE id_item= ID_ITEM_1;
					CALL insertMutasi(ID_ITEM_1, VALUE_1, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_2, (VALUE_1 * KONVERSI_2), 'INVERSI');
				END IF;
			ELSE
				UPDATE item_stock set stock=QTY_UPDATE WHERE id_item=P_KODEITEM;
			END IF;
		END IF;
		
		IF(TMP=3) THEN
			SET QTY_UPDATE := STOCK_3 - P_QTY;
			IF(QTY_UPDATE<0) THEN
				SET VALUE_2 = 1;
				SET SISA = (KONVERSI_3 * VALUE_2) + QTY_UPDATE;
				WHILE SISA<0 DO
					SET VALUE_2 = VALUE_2+1;
					SET SISA = (KONVERSI_3 * VALUE_2) + QTY_UPDATE;
				END WHILE;
				SET QTY_UPDATE = SISA;
				
-- 				cek stok satuan 2
				SET QTY_UPDATE_2 = STOCK_2 - VALUE_2;
				IF(QTY_UPDATE_2 < 0) THEN
					SET VALUE_1 = 1;
					SET SISA = (KONVERSI_2 * VALUE_1) + QTY_UPDATE_2;
					
					IF(KONVERSI_2 > 0) THEN 
						WHILE SISA<0 DO
							SET VALUE_1 = VALUE_1+1;
							SET SISA = (KONVERSI_2 * VALUE_1) + QTY_UPDATE_1;
						END WHILE;
					END IF;
					SET QTY_UPDATE_2 = SISA;
				ELSE
					SET VALUE_1 = 0;
				END IF;
				
				UPDATE item_stock set stock=QTY_UPDATE WHERE id_item=P_KODEITEM;
				IF (VALUE_2 > 0) THEN
					UPDATE item_stock set stock=QTY_UPDATE_2 WHERE id_item=ID_ITEM_2;
					CALL insertMutasi(ID_ITEM_2, VALUE_2, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_1, (VALUE_2 * KONVERSI_3), 'INVERSI');
				END IF;
				
				IF (VALUE_1 > 0) THEN
					UPDATE item_stock set stock=stock-VALUE_1 WHERE id_item=ID_ITEM_1;
					CALL insertMutasi(ID_ITEM_1, VALUE_1, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_2, (VALUE_1 * KONVERSI_2), 'INVERSI');
				END IF;
			ELSE
				UPDATE item_stock set stock=QTY_UPDATE WHERE id_item=P_KODEITEM;
			END IF;
		END IF;
		
		IF(TMP=2) THEN
			SET QTY_UPDATE = STOCK_2 - P_QTY;
			IF(QTY_UPDATE<0) THEN
				SET VALUE_1 = 1;
				SET SISA = (KONVERSI_2 * VALUE_1) + QTY_UPDATE;
				
				IF(KONVERSI_2 > 0) THEN 
					WHILE SISA<0 DO
						SET VALUE_1 = VALUE_1 + 1;
						SET SISA := (KONVERSI_2 * VALUE_1) + QTY_UPDATE;
					END WHILE;
				END IF;
				SET QTY_UPDATE = SISA;
				
				UPDATE item_stock set stock=QTY_UPDATE WHERE id_item=P_KODEITEM;
				
				IF (VALUE_1 > 0) THEN
					UPDATE item_stock set stock=stock-VALUE_1 WHERE id_item=ID_ITEM_1;
					CALL insertMutasi(ID_ITEM_1, VALUE_1, 'KONVERSI');
					CALL insertMutasi(ID_ITEM_2, (VALUE_1 * KONVERSI_2), 'INVERSI');
				END IF;
			ELSE
				UPDATE item_stock set stock=QTY_UPDATE WHERE id_item=P_KODEITEM;
			END IF;
		END IF;
	ELSE
		UPDATE item_stock set stock=stock-P_QTY WHERE id_item=P_KODEITEM;
	END IF;
	
	CALL insertMutasi(P_KODEITEM, P_QTY, P_TYPE);
END
;;
delimiter ;

