DROP TRIGGER IF EXISTS `insertbayarhutang`;
delimiter ;;
CREATE TRIGGER `insertbayarhutang` AFTER INSERT ON `bayar_hutang` FOR EACH ROW BEGIN
	DECLARE sisa_hutang INT;
	
	UPDATE hutang SET terbayar=terbayar+new.total, sisa=sisa-new.total WHERE id=new.id_hutang;
	
	SELECT sisa INTO sisa_hutang FROM hutang WHERE id=new.id_hutang;
	IF sisa_hutang = 0  THEN
		UPDATE hutang SET flag=1 WHERE id= new.id_hutang;
	END IF;
END
;;
