DROP TRIGGER IF EXISTS `afterinsertitemstock`;
delimiter ;;
CREATE TRIGGER `afterinsertitemstock` AFTER INSERT ON `item_stock` FOR EACH ROW BEGIN
DECLARE count integer;
SET @count:=(SELECT COUNT(kode_item) FROM mutasi_stock WHERE kode_item=new.id_item AND tran_date=CURDATE());
	IF(@count=0) THEN
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK AWAL',new.stock);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'PURCHASE',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'SALE',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK OUT',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK OPNAME',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK AKHIR',new.stock);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'KONVERSI',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'INVERSI',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'REFUND',0);
	END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table item_stock
-- ----------------------------
DROP TRIGGER IF EXISTS `beforeupdateitemstock`;
delimiter ;;
CREATE TRIGGER `beforeupdateitemstock` BEFORE UPDATE ON `item_stock` FOR EACH ROW BEGIN
DECLARE count integer;
DECLARE tempstock integer;
SET @count:=(SELECT COUNT(kode_item) FROM mutasi_stock WHERE kode_item=new.id_item AND tran_date=CURDATE());
	IF(@count=0) THEN
		SET @tempstock:=(SELECT stock FROM item_stock WHERE id_item=new.id_item);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK AWAL',@tempstock);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'PURCHASE',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'SALE',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK OUT',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK OPNAME',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'KONVERSI',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'INVERSI',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'REFUND',0);
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK AKHIR',@tempstock);
	END IF;
END
;;
delimiter ;

