DROP TRIGGER IF EXISTS `afterupdateitemstock`;
delimiter ;;
CREATE TRIGGER `afterupdateitemstock` AFTER UPDATE ON `item_stock` FOR EACH ROW BEGIN
DECLARE count integer;
SET @count:=(SELECT COUNT(kode_item) FROM mutasi_stock WHERE kode_item=new.id_item AND tipe_mutasi='STOCK AKHIR' AND tran_date=CURDATE());
	IF(@count=0) THEN
		INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.id_item,'STOCK AKHIR',new.stock);
	ELSE
