-- ----------------------------
-- Triggers structure for table purchase_detail
-- ----------------------------
DROP TRIGGER IF EXISTS `afterinsertpurchase`;
delimiter ;;
CREATE TRIGGER `afterinsertpurchase` AFTER INSERT ON `purchase_detail` FOR EACH ROW BEGIN
	DECLARE count integer;
	IF(new.flag=1) THEN
		SET @count:=(SELECT COUNT(id_item) FROM item_stock WHERE id_item=new.kode_item);
		IF(@count=0) THEN
			INSERT INTO item_stock VALUES (new.kode_item,0);
		END IF;
		UPDATE item_stock set stock=stock+new.qty_terima WHERE id_item=new.kode_item;
		CALL insertMutasi(new.kode_item, new.qty, 'PURCHASE');
	END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table purchase_detail
-- ----------------------------
DROP TRIGGER IF EXISTS `afterupdatepurchase`;
delimiter ;;
CREATE TRIGGER `afterupdatepurchase` AFTER UPDATE ON `purchase_detail` FOR EACH ROW BEGIN
	DECLARE count integer;
	IF(new.flag=1) THEN
		IF(new.qty_terima>0) THEN
			SET @count:=(SELECT COUNT(id_item) FROM item_stock WHERE id_item=new.kode_item);
			IF(@count=0) THEN
				INSERT INTO item_stock VALUES (new.kode_item,0);
			END IF;
			UPDATE item_stock set stock=stock+new.qty_terima WHERE id_item=new.kode_item;

			SET @count:=(SELECT COUNT(kode_item) FROM mutasi_stock WHERE kode_item=new.kode_item AND tipe_mutasi='PURCHASE' AND tran_date=CURDATE());
			IF(@count=0) THEN
				INSERT INTO mutasi_stock VALUES (UUID(),CURDATE(),new.kode_item,'PURCHASE',new.qty_terima);
			ELSE
				UPDATE mutasi_stock SET qty=qty+new.qty_terima WHERE tran_date=CURDATE() AND kode_item=new.kode_item AND tipe_mutasi='PURCHASE'; 
			END IF;
		END IF;	
	END IF;
END
;;
delimiter ;

